import React from "react";
import './cart.css'
import{ICourse} from'../Interface/ICourse'

const Cart = (props: { data:ICourse[]}) => {
  return(
    <div> {props.data.map((value,key)=>{

      return (
        <div className="cart" key={value.id}>
          <label className="title">{value.Tittle}</label>
          <button className="tag">{value.Tags}</button>
          <label className="author">{value.Author}</label>
          <label className="price">{value.ActualPrice}</label>

        </div>
      );

      })} </div>
  );
}

export default Cart;
